import { useState } from "react"

export default function WithCouhnter(){
    const Newcomponenet =()=>{
        const [Count , setCount]=useState(0)
        const incriment=(e)=>{
            e.preventDefault()
            setCount(prevent => prevent + 1)
        }
    }
   
    return(
        <>
        {Count}
        <button type="button" onClick={incriment}>click</button>
        </>
    )
}
